(32, 1, '2018-05-17 11:38:57', '2018-05-17 14:38:57', '[vc_row tdc_css=\"eyJhbGwiOnsiYm9yZGVyLXRvcC13aWR0aCI6IjEiLCJib3JkZXItY29sb3IiOiIjZTZlNmU2In19\"][vc_column width=\"2/3\"][vc_column_text border_top=\"no_border_top\"]<p>Objeto y Aceptación de los Términos y Condiciones de Uso Estos Términos y Condiciones de uso</p><p>Tienen por objeto regular el uso que realicen las personas que ingresen al sitio \"yerbabuenadigital.com\" (en adelante, el \"Sitio Web\"). El solo ingreso \"yerbabuenadigital.com\", por parte de un usuario implica la aceptación completa de los Términos y Condiciones de Uso que se detallan a continuación.</p><p><strong>Objeto del Sitio Web \"yerbabuenadigital.com\"</strong><br />Está orientado a difundir información y material periodístico relacionado con la actividad cultural, turística, social, económica y política internacional. Asimismo, el Sitio Web tiene como objetivo ofrecer a los usuarios distintos productos y/o servicios publicitados tanto por \"yerbabuenadigital.com\" como por terceros.</p><p><strong>Usos del Sitio Web</strong><br />El uso del Sitio Web es exclusiva responsabilidad del usuario, quien en todo caso deberá servirse del mismo acorde a las funcionalidades permitidas en el propio sitio y a los usos autorizados en los presentes Términos y Condiciones de Uso, por lo que el usuario se obliga a utilizarlos de modo tal que no atenten contra las normas de uso y convivencia en Internet, las leyes de la República Argentina y la legislación vigente en el país en que el usuario se encuentre al usarlos, las buenas costumbres, la dignidad de la persona y los derechos de terceros. Los usuarios se comprometen a utilizar los servicios o contenidos exclusivamente para su uso personal, y a no realizar ni directa ni indirectamente una explotación comercial de los mismos. Los usuarios no tienen el derecho de colocar hipervínculos de y hacia el Sitio Web, ni el derecho de colocar o utilizar los contenidos del mismo en sitios o páginas propias o de terceros sin autorización previa y por escrito de \"yerbabuenadigital.com\". Asimismo, los usuarios no tendrán el derecho de limitar o impedir a cualquier otro usuario el uso del Sitio Web.</p><p><strong>Protección de los datos personales</strong><br />La información y/o datos que voluntariamente faciliten los usuarios a través del Sitio Web o a través de los servicios a los que accedan, o de las promociones en las que participen, podrán ser incorporados a la base de datos titularidad de \"yerbabuenadigital.com\" con la finalidad de realizar la gestión y el mantenimiento de las relaciones con tales usuarios., es decir poder enviarles información sobre los productos de \"yerbabuenadigital.com\", boletines de noticias, publicidad, así como nuevas ofertas, promociones o concursos o para la realización de estudios de mercado o estadísticos. Derechos de acceso, rectificación, actualización y supresión En cumplimiento de lo dispuesto en la LPDP, los usuarios podrán ejercitar sus derechos de acceso, rectificación, actualización y supresión, contactándose con \"yerbabuenadigital.com\", por correo electrónico contacto@yerbabuenadigital.com. A tal fin, es necesario especificar el nombre y apellido, dirección y teléfono, o en su defecto, el nombre de usuario utilizado en el portal. Ningún tercero ajeno a \"yerbabuenadigital.com\", salvo los supuestos amparados por la legislación vigente, tendrá acceso a la información y/o datos personales de los usuarios del Sitio Web. En ningún caso \"yerbabuenadigital.com\" cederá a terceros datos personales de menores que accedan al portal.</p><p><strong>Cookies</strong><br />Es intención de \"yerbabuenadigital.com\" ofrecer un servicio personalizado y un trato preferencial. Para poder utilizar todos los servicios que brinda \"yerbabuenadigital.com\". será necesario tener habilitadas las cookies. En ningún caso estos elementos servirán para identificar a una persona concreta, ya que su uso será meramente técnico, para ofrecer un mejor servicio a los usuarios y permitir la realización de contenidos avanzados. Estas cookies no servirán para la realización de estudios comerciales ni darán información acerca de los hábitos de navegación de los usuarios. El usuario podrá deshabilitar el uso de cookies a través de las opciones de su navegador, si bien \"yerbabuenadigital.com\" no podrá garantizar en este caso el correcto funcionamiento de todos los servicios ofrecidos en el Sitio Web.</p><p><strong>Confidencialidad y seguridad en el tratamiento de los datos personales y en las comunicaciones electrónicas</strong><br />\"yerbabuenadigital.com\" se compromete a tratar de forma absolutamente confidencial los datos de carácter personal del usuario, adoptando las medidas de seguridad de índole técnica y organizativas necesarias para garantizar la seguridad de los mismos y evitar su alteración, pérdida, tratamiento y/o acceso no autorizado. \"yerbabuenadigital.com\" asegura, dentro de lo posible y conforme al estado actual de la tecnología, la confidencialidad e integridad de los datos e información que los usuarios faciliten para cumplir con las finalidades antes indicadas. Comunicaciones comerciales no solicitadas \"yerbabuenadigital.com\" no enviará comunicaciones publicitarias ni promocionales a través del e-mail, u otro medio de comunicación electrónico equivalente, si previamente no hubieran sido solicitadas o expresamente autorizadas por los destinatarios de las mismas. Lo dispuesto en el apartado anterior no será de aplicación cuando exista una relación contractual previa y se hubieran obtenido los datos de contacto del destinatario con el consentimiento expreso del mismo.</p><p><strong>Propiedad intelectual e industrial</strong><br />El Sitio Web incluye contenidos, textos, documentos, material publicitario, dibujos, material técnico de productos o de cualquier otro orden, bases de datos, sonidos, programas de software, distintivos corporativos, signos distintivos, marcas, diseños gráficos, combinaciones de elementos, logotipos e imágenes, que están protegidos por derechos de propiedad intelectual o industrial de los que \"yerbabuenadigital.com\" es titular o legítima licenciataria. En este sentido, queda terminantemente prohibida la reproducción total o parcial, comunicación pública, modificación, transformación, copia, distribución, o cualquier otra forma de explotación y manipulación del Sitio Web, de sus dispositivos técnicos, contenidos, aplicaciones, códigos fuente, diseño, selección y forma de presentación de los materiales y, en general, respecto de la información contenida en el Sitio Web. Queda, asimismo, prohibido descomponer, realizar ingeniería inversiva o, en general, transmitir de cualquier modo o realizar obras derivadas de los programas de ordenador necesarios para el funcionamiento y acceso del Sitio Web y de los servicios aquí contenidos, así como realizar, respecto de los mismos cualquier acto de explotación. Servicios prestados por terceros \"yerbabuenadigital.com\" no se responsabiliza por el uso ni por la idoneidad de los servicios prestados por terceros (herramientas, accesos digitales, estudios de mercado, etc), ni por la suspensión de dichos servicios, por lo que se excluye de cualquier responsabilidad por los daños y perjuicios de toda naturaleza que puedan deberse a los mismos.</p><p><strong>Garantía de Indemnidad</strong><br />Cada Usuario se compromete a indemnizar y mantener indemne a \"yerbabuenadigital.com\", sus empresas controladas y/o controlantes, directivos, representantes, apoderados y empleados de todas ellas, por cualquier reclamo o demanda de otros usuarios o terceros por sus actividades en el Sitio Web o por su incumplimiento a estos Términos y Condiciones de Uso y demás políticas que se entiendan parte de ellos, o por la violación de cualesquiera leyes o derechos de terceros.</p><p><strong>Modificación</strong><br />\"yerbabuenadigital.com\" se reserva el derecho de modificar en forma unilateral, sin mediar previo aviso, ni comunicación los usuarios, estos Términos y Condiciones de Uso, como así el diseño, la presentación o configuración del Sitio Web, sin que ello genere derecho a reclamo o indemnización alguna en favor de los usuarios. En consecuencia, el usuario debe leer atentamente los Términos y Condiciones de Uso cada vez que pretenda utilizar el Sitio Web.</p>[/vc_column_text][vc_row_inner][vc_column_inner width=\"1/2\"][/vc_column_inner][vc_column_inner width=\"1/2\"][/vc_column_inner][/vc_row_inner][vc_row_inner][vc_column_inner width=\"1/1\"][/vc_column_inner][/vc_row_inner][/vc_column][vc_column width=\"1/3\"][td_block_2 limit=\"3\" custom_title=\"LATEST POSTS\" td_filter_default_txt=\"All\" border_top=\"no_border_top\"][/vc_column][/vc_row]', 'Términos y condiciones', '', 'publish', 'open', 'closed', '', 'terminos-y-condiciones', '', '', '2018-05-18 14:57:56', '2018-05-18 17:57:56', '', 0, 'http://td_uid_1_5afd9401496a3', 0, 'page', '', 0),
