\n\r\n</div>\r\n<div class=\"td-paragraph-padding-1\">\r\n<h3><strong>A Bicyclops Built For Two</strong></h3>\r\nI love you, buddy! Yep, I remember. They came in last at the Olympics, then retired to promote alcoholic beverages! The more you tighten your grip, Tarkin, the more star systems will slip through your fingers.\r\n<ul>\r\n	<li>I saw you with those two \"ladies of the evening\" at Elzars.</li>\r\n	<li>For the last time, I don\'t like lilacs! Your first wife was the one.</li>\r\n	<li>But the flesh is spongy and spanac bruised?</li>\r\n</ul>\r\n</div>\r\n<div class=\"td-paragraph-padding-1\">\r\n\r\nOh, all right, I am. But if anything happens to me, tell them I died robbing some old man. When will that be? Well, take care of yourself, Han. I guess that\'s what you\'re best at, ain\'t it? I don\'t know what you\'re talking about.\r\n\r\n</div>\r\n<div class=\"td-paragraph-padding-0\">\r\n\r\n[caption id=\"attachment_1657\" align=\"alignleft\" width=\"294\"]<a href=\"http://yerbabuenadigital.com/wp-content/uploads/2018/05/p2.jpg\"><img class=\"td-modal-image td-post-image-left wp-image-1657 \" src=\"http://yerbabuenadigital.com/wp-content/uploads/2018/05/p2.jpg\" alt=\"photo2\" width=\"294\" height=\"477\" /></a> Progress is a nice word.[/caption]\r\n\r\nDaylight and everything. This is the worst part. The calm before the battle. I saw you with those two \"ladies of the evening\" at Elzars. <a href=\"#\">Explain</a> that. Leela, Bender, we\'re going grave robbing. Who am I making this out to?\r\n\r\nIt\'s nice to just embrace the natural beauty within you. Who am I making this out to? Shut up and get to the point!\r\n\r\nAnd remember, don\'t do anything that affects anything, unless it turns out you were supposed to, in which case, you mean while for the love of God, don\'t not do it!\r\n\r\nDoomsday device? Ah, now the ball\'s in Farnsworth\'s court! You mean while I\'m sleeping in it? Shut up and get to the point!\r\n\r\n</div>\r\n<div class=\"td-paragraph-p